pragma solidity ^0.5.10;

contract TaskAppContract {
    struct Task {
        uint id;
        string description;
        uint due_date;
        bool status;
    }

    mapping(uint => Task) private taskList;
    uint public taskID;
    
    function addTask (string memory _description, uint due_date) public {
        taskID ++;
        taskList[taskID] = Task(taskID, _description, due_date, false); // Creates a new house & stores it into taskList
    }
    function getTask(uint _id) public view returns (string memory description, uint due_date, bool status){
        return (taskList[_id].description, taskList[_id].due_date, taskList[_id].status);
    }
}
